# https://reactome.org/sparql
SELECT DISTINCT ?molecule ?moleculeName ?chebiIdentifier WHERE {
  # Find Human pathways
  ?pathway a <http://schema.reactome.org/Pathway> ;
           <http://schema.reactome.org/species> <http://identifiers.org/taxonomy/9606> . # Human species URI

  # Find Reactions within these pathways (traverse through sub-events)
  ?pathway <http://schema.reactome.org/hasEvent>* ?event .
  ?event a <http://schema.reactome.org/ReactionlikeEvent> .

  # Find molecules involved in the reaction (inputs or outputs)
  { ?event <http://schema.reactome.org/input> ?molecule }
  UNION
  { ?event <http://schema.reactome.org/output> ?molecule }

  # Filter for SimpleEntity, which often represents metabolites in Reactome
  ?molecule a <http://schema.reactome.org/SimpleEntity> ;
            <http://schema.reactome.org/displayName> ?moleculeName .

  # Try to get ChEBI identifier if available
  OPTIONAL {
    ?molecule <http://schema.reactome.org/identifier> ?identifier .
    FILTER (STRSTARTS(STR(?identifier), "CHEBI:"))
    BIND(REPLACE(STR(?identifier), "CHEBI:", "") AS ?chebiIdentifier)
  }
}
LIMIT 100

