PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rh: <http://rdf.rhea-db.org/>
PREFIX sachem: <http://bioinfo.uochb.cas.cz/rdf/v1.0/sachem#>


SELECT 
  ?rhea 
  ?chebi
WHERE {
  SERVICE <https://idsm.elixir-czech.cz/sparql/endpoint/chebi> {
    ?chebi sachem:substructureSearch [
        sachem:query "[C@]12(CCC3CCCC[C@]3(C)[C@@]1([H])CC[C@]1(C)[C@@]([H])([C@@](C)([H])CCCC(C)C)CC[C@@]21[H])[H]" ].
  }
  ?rhea rh:side/rh:contains/rh:compound/rdfs:subClassOf ?chebi .
}

predicted_query:
# Primary endpoint: https://idsm.elixir-czech.cz/sparql
PREFIX sachem: <http://sachem.org/vocab/>
PREFIX chebi: <http://purl.obolibrary.org/obo/CHEBI_>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT DISTINCT ?chebi ?reaction
WHERE {
  # Find ChEBI compounds with the CHEBI:35516 (Cholestane) skeleton using the Sachem index at EBI
  SERVICE <https://sparql.ebi.ac.uk/sparql> {
    ?chebi sachem:skos chebi:35516 .
  }

  # Find Rhea reactions that contain these ChEBI compounds
  SERVICE <https://sparql.rhea-db.org/sparql> {
    ?reaction rhea:contains ?participant .
    ?participant rhea:chebi ?chebi .
    # rhea:contains property typically links to participants which are part of a reaction,
    # implicitly identifying ?reaction as a Rhea reaction.
  }
}

# https://sparql.uniprot.org/sparql
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rhea: <http://rdf.rhea-db.org/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX chebi: <http://purl.obolibrary.org/obo/CHEBI_>

SELECT DISTINCT ?metabolite
WHERE {
  # Find human reference proteome proteins
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:proteome ?proteome .
  ?proteome a up:ReferenceProteome .

  # Find reactions catalyzed by these proteins
  ?protein rhea:catalyzedBy ?reaction .

  # Find metabolites (substrates and products) of these reactions using SERVICE
  SERVICE <https://sparql.rhea-db.org/sparql> {
    {
      # Find substrates of the reaction
      ?reaction rhea:substrate ?substrateParticipant .
      # Find the chemical entity (metabolite, typically ChEBI) within the participant
      ?substrateParticipant rhea:contains ?metabolite .
      # Ensure the entity is a ChEBI identifier
      FILTER(STRSTARTS(STR(?metabolite), STR(chebi:)))
    } UNION {
      # Find products of the reaction
      ?reaction rhea:product ?productParticipant .
      # Find the chemical entity (metabolite, typically ChEBI) within the participant
      ?productParticipant rhea:contains ?metabolite .
      # Ensure the entity is a ChEBI identifier
      FILTER(STRSTARTS(STR(?metabolite), STR(chebi:)))
    }
  }
}
